import React from 'react';
import './stylesheets/App.css';
import Curve from "./Curve";
var curves = [];
class App extends React.Component {
  addCurve = () => {
  	curves.push("hey");
  }
  render(){
    return (<div>
    			<div>{curves.map((c, i) => <Curve />)}</div><br/>
    			<button onclick={this.addCurve}>Add Curve</button>
    		</div>);
  }  
}

export default App;
